import Layout from '../components/Layout';
import Link from 'next/link';

type colorType = {
  color: {
    name: {
      value: string;
    };
  };
};

const IndexPage = ({
  color: {
    name: { value },
  },
}: colorType) => {
  console.log(value);

  return (
    <Layout>
      <div className="container text-center mt-4">
        <h1 className="title my-0">Welcome to Color View!</h1>
        <p className="desc my-3">What do you want to do?</p>

        <Link href="/random">
          <button className="btn btn-secondary mr-5">
            Get some random color
          </button>
        </Link>

        <Link href="/colorname">
          <button className="btn btn-secondary">Get a color name</button>
        </Link>
      </div>
    </Layout>
  );
};

// fetch function
export const getStaticProps = async () => {
  const res = await fetch('https://www.thecolorapi.com/id?hex=24B1E0');

  return {
    props: {
      color: await res.json(),
    },
  };
};

export default IndexPage;

